import * as React from 'react';

function HeadBody(){
  return (
    <div className='p-5 text-white gap-10'>
        <h1 className='text-5xl pt-60 pb-5'>Quality Barber Shop</h1>
        <p className='text-sm'>Lorem ipsum dolr sit amet, consectutuer adipisicing elit, sed do eismod tempor incididunt er dolore magna aliqua</p>
        
        <div className='flex-col'>
            <div><button type="button" className='text-white border-2'>LEARN MORE</button></div>
            <div><button type="button" className='text-white border-2'>CONTACT US</button></div>
        </div>
    </div>
  );
}

export default HeadBody
